import React from 'react';
import './card-info-style.scss';
//import data from '../../data-src';
function turntopresje(num){
    var digit = num.toString().split('');
    var sum = ""; var count = 0;
    for(let i=0; i<digit.length;i++){
        sum+=digit[i] ; count=count+1;
        if(count%3 === 0 && count !== 0){
            sum+=',';
        }
    }
    return sum;
}
console.log(turntopresje(2143243253));
const Cardata = (props)=>(
            <div className="stats">
                <section className="card">
                            <h1 className="card-header">{props.head1}</h1>
                            <span className="card-num blue">{props.data.TotalConfirmed}</span>
                            <span className="card-text">Cases</span>
                            <span className="card-num green">{props.data.TotalRecovered}</span>
                            <span className="card-text">Healed</span>
                            <span className="card-num red">{props.data.TotalDeaths}</span>
                            <span className="card-text">Deaths</span>
                        </section>
                        <section className="card">
                            <h1 className="card-header">{props.head2}</h1>
                            <span className="card-num blue">{props.data.NewConfirmed}</span>
                            <span className="card-text">Cases</span>
                            <span className="card-num green">{props.data.NewRecovered}</span>
                            <span className="card-text">Healed</span>
                            <span className="card-num red">{props.data.NewDeaths}</span>
                            <span className="card-text">Deaths</span>
                        </section>
                </div>  
            )
        
  

export default Cardata;


